import './App.css';
import Header from './components/Header/index'
import List from './components/List/index'

import Footer from './components/Footer/index'

function App() {
  return (
        <div class="todo-container">
            <div class="todo-wrap">
                 <Header/>
                 <List/>
                 <Footer/>
             </div>
        </div>
         )


}

export default App;
